import{_ as e,o as a,c as t,O as m}from"./chunks/framework.62a149d4.js";const z=JSON.parse('{"title":"一、功能概览","description":"","frontmatter":{},"headers":[],"relativePath":"Docs/siignature.md","filePath":"Docs/siignature.md"}'),s={name:"Docs/siignature.md"},p=m('<h1 id="一、功能概览" tabindex="-1">一、功能概览 <a class="header-anchor" href="#一、功能概览" aria-label="Permalink to &quot;一、功能概览&quot;">​</a></h1><h2 id="_1-业务功能" tabindex="-1">1.业务功能 <a class="header-anchor" href="#_1-业务功能" aria-label="Permalink to &quot;1.业务功能&quot;">​</a></h2><ol><li>文件签署：包括签署流程、模板管理、模板包三个子菜单。</li><li>签署流程：可以发起合同电子签并查看电子签的进度。</li><li>模板管理：配置合同模板以及文件的签章位置。包括模板电子签和上传电子签。</li><li>模板包：设置模板的匹配规则，并可以将多个模板绑定到一个模板包中同时签署。</li></ol><h2 id="_2-配置功能" tabindex="-1">2.配置功能 <a class="header-anchor" href="#_2-配置功能" aria-label="Permalink to &quot;2.配置功能&quot;">​</a></h2><ol><li>模板管理：配置合同模板以及文件的签章位置。包括模板电子签和上传电子签。</li><li>模板包：设置模板的匹配规则，并可以将多个模板绑定到一个模板包中同时签署。</li></ol><h1 id="二、配置功能操作指引" tabindex="-1">二、配置功能操作指引 <a class="header-anchor" href="#二、配置功能操作指引" aria-label="Permalink to &quot;二、配置功能操作指引&quot;">​</a></h1><h2 id="模板管理" tabindex="-1">模板管理 <a class="header-anchor" href="#模板管理" aria-label="Permalink to &quot;模板管理&quot;">​</a></h2><p>配置合同模板以及文件的签章位置，包括模板电子签和上传电子签。</p><p>支持通过材料名称进行搜索。</p><p>支持新增、编辑、删除模板。注：已被模板包引用的材料不可删除。</p><p>新增文件模板需选择文件签署类型，分为上传电子签和模板电子签。</p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/56dffd34-eb46-421f-93c9-6ba019606fef/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072032Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=07a453edd58cb095b189e04f5ec807bcd992aa979332fdfd4f1615dc84681f89&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><p>模板管理新增/编辑页面：</p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/131ddf4b-aab9-48c1-8334-46599d8132ba/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072032Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=479688e6ded034d0f84bff78ccd8e867fd94d469c76916a93d5046a318d691ef&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><h2 id="模板包" tabindex="-1">模板包 <a class="header-anchor" href="#模板包" aria-label="Permalink to &quot;模板包&quot;">​</a></h2><p>设置模板的匹配规则，可以将多个模板绑定到一个模板包中同时签署。</p><p>支持通过合同模板名称进行搜索，可新增、编辑、删除模板匹配规则，点击模板名称可编辑模板内容。</p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/431e87ad-4ee7-4657-a87a-803b6f8e2d49/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072032Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=107f01a809b61b371443222b41eeb56b25d7d3f655aea704390771b974c8e294&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/d82de18e-07c0-40db-a7a7-5e4d74554d80/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072032Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=657f81cbe08d2f2b470c89155f05b5bfc446c150d5f8f253335e926e1263c7ff&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><p>模板名称：按需填写</p><p>模板说明：按需填写，非必填</p><p>所属业务流程：仅使用合同新签、合同续签</p><p>是否启用工作流：默认关闭，可手动开启</p><p>是否合并发送：影响员工H5签署页面的展示样式，打开后一个模板包的所有文件放在一个卡片中展示，关闭后一个文件一个卡片展示，默认关闭</p><p>匹配条件：配置该模板包与员工的匹配条件</p><h2 id="开具证明配置" tabindex="-1">开具证明配置 <a class="header-anchor" href="#开具证明配置" aria-label="Permalink to &quot;开具证明配置&quot;">​</a></h2><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/e79c2db8-70dd-48ce-8099-78b62baff800/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072032Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=3486404fab2f87eaffdbe79091de65f3e47b125ffe84b8d635eb51b72f20cf32&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><p><a href="./.html">embed</a></p><h1 id="三、业务功能操作指引" tabindex="-1">三、业务功能操作指引 <a class="header-anchor" href="#三、业务功能操作指引" aria-label="Permalink to &quot;三、业务功能操作指引&quot;">​</a></h1><h2 id="签署流程" tabindex="-1">签署流程 <a class="header-anchor" href="#签署流程" aria-label="Permalink to &quot;签署流程&quot;">​</a></h2><p>可以发起合同电子签并查看电子签的进度，分为待发起、签署中、已完成、作废中、已撤销、已作废六种进度。</p><p>支持以下通用筛选条件：姓名、合同名称、签订类型、合同公司、用工类型、发起日期、手机号、公司邮箱。</p><p>支持导出。</p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/36e13d17-2c6f-437d-bed6-9a0f7859636d/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072032Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=2190546c974237f06ed75ea5774ca0b64ff6a1edeee371e1c5efeddef8df57d3&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><ol><li>待发起</li></ol><p>支持三种发起签署方式</p><p>发起签署（列表上方）：选人发起签署，支持导入多人批量发起</p><p>批量发起：选取列表多条数据发起签署</p><p>发起签署（列表右侧）：对指定数据发起签署</p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/c540b18e-5a4c-48a1-a234-e8d068ef59d0/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072032Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=bbe3cd5c5ecd66cf13f17946931cc4ed6f6b27ffbd38ebe0ef0f54770c3570ad&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/6aec2bc8-4cd3-4a54-ba1f-82134f005af9/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072032Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=584e41f5f69bd7a287cc32f0753b736b6c6c5d04b47514ab910f03b013e89c5a&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/9c763b3f-aeb3-42b8-9708-e7a170cccb54/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072032Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=73d4bd481bed9903cb355d42818210e484cfb1e4a328da49c0c6631e037128a5&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/8c42e504-7008-4993-bec5-b89a18dd8c01/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072032Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=d2eaee908ef78cb7c694406a0a36c436fa81480c99ff6c85db056538fc89b801&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><p>合同模板：根据选取的签署员工，自动匹配符合条件的模板并从中选择</p><p>签署文件：选择合同模板后根据模板内容自动带出（模板设置见2.4 签署模板），上传文件、点击下载查看、删除不需要的文件</p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/6b23937d-ee7d-4869-8e66-23a10e5da2f4/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072032Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=94f713de0b97397905ef5360cafb5938bf359999838982ce930918cffe93c491&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><p>注：勾选列表页面多人，点击批量发起按钮系统自动判断员工与模板匹配情况。其中，黄色字体显示匹配失败，可能的原因为：该员工无匹配的模板，或该员工匹配的模板大于1个。</p><ol><li>处理中</li></ol><p>查看未签署完成的合同记录，包括待员工签和待公司签两种类型。支持撤回未签署完成的合同、查看详情。</p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/77017a8e-463c-420e-9d84-0a1b52c149ba/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072032Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=3802c30d9fe9969d4debdf6be26de49427795f870dee138fd3a34a5756f56639&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><p>注：</p><p>点击详情在新窗口查看该签署中合同详情，点击合同附件的pdf文件自动下载文件到本地。若该文件为模板电子签，可核对其中带出字段是否正确。</p><p>如果模板电子签中的字段选择了“使用时手动填写”，那么需要员工填写提交对应字段后，预览的pdf才会带出</p><p>点击撤回在二次确认弹窗中输入撤回原因，点击确认后，该数据流转至“已撤销”标签页列表中。</p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/bb47aaa5-9dd1-4998-86dc-b82bc469a976/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072032Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=3de0fbea42c5ab343ed93e976ef40473d627d39c6fff821a189425e850a9e868&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><ol><li>已完成</li></ol><p>查看签署完成的合同数据，支持作废已完成的合同，需要员工再次签署确认后，数据流转至“已作废”标签页列表中。</p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/495933bf-ff28-43ab-b8e4-e07769031cea/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072032Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=5fd53497f495a263504c7143025a95a721d2f0087a112b6565ce967213fdb51c&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><ol><li>作废中</li></ol><p>发起作废后员工未签署的合同数据在此列表显示，支持查看详情。</p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/7a55b6b9-8767-4b48-83fb-397e6277e14c/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072032Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=b69846c7af9c9f994c913c1a631d8de5352163b6bee950cc3502387da9883009&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><ol><li>已撤销</li></ol><p>已撤销的合同数据在此列表显示，支持重新发起和查看详情。</p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/078d0599-0687-4ddc-85bc-062aefbd8033/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072032Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=06838c6c184a514b4889b962d978bd88271fcc994d595eb563604f88049c07f7&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><ol><li>已作废</li></ol><p>列表展示已作废的合同数据，支持查看详情，下载已作废的文件。</p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/cab8f664-4cdc-4d7e-aa4c-8a55d3d07440/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072032Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=033b1c8ae27394ce3c0d9698f6b110bab6ddfd9d2ce890cf10d13453dd80c679&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/2f48741c-4030-4572-b0a5-f03f39765993/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072032Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=f17a2f1fe0ee26bf4c79e23f085b1a543e8fd2cb622e149563aef5c17e908b06&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><h2 id="移动端文件签署流程" tabindex="-1">移动端文件签署流程 <a class="header-anchor" href="#移动端文件签署流程" aria-label="Permalink to &quot;移动端文件签署流程&quot;">​</a></h2><ol><li>登录</li></ol><p>进入登录页面输入账号和密码进入首页，点击【合同】模块</p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/04d742a0-5c59-436b-85c3-aefa7727330c/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072032Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=082b9fb4e892630146a596e76d55bc1b80c7436804b0645ecfceb9307e51d44e&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><ol><li>待我处理</li></ol><h3 id="去签署" tabindex="-1">去签署 <a class="header-anchor" href="#去签署" aria-label="Permalink to &quot;去签署&quot;">​</a></h3><p>需签署的文件展示在【待我处理】tab下，点击对应文件下的【去签署】按钮</p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/65d25693-6a11-4c43-995a-8a086e8b2965/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072032Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=999d22010eec41f119fa910e13009a1e75fb41112c4ba6929f6e564ecb5953c0&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><h3 id="信息录入" tabindex="-1">信息录入 <a class="header-anchor" href="#信息录入" aria-label="Permalink to &quot;信息录入&quot;">​</a></h3><p>填写需带入电子签文件的字段信息，如未配置填写字段则直接进入电子签文件预览页面。</p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/a50bf854-0932-4be3-b5f8-ccdba4908dcd/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072038Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=7fb24d096da7591af9731217d8d8185ae23552193672a4872f821829b101c700&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/c660669a-6256-480c-90e7-1d32694812a3/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072039Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=dd1c01fca220431b7c30fcf83fe12a97c3112c5497bac76f231ee795db88071a&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><h3 id="签名-完成签署" tabindex="-1">签名-完成签署 <a class="header-anchor" href="#签名-完成签署" aria-label="Permalink to &quot;签名-完成签署&quot;">​</a></h3><p>首次需点击【+】输入签名，维护后可点击选择，选择后签名将自动带入到签名位置。</p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/0df1705e-f039-4a3e-9e73-298b31e1c2e5/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072042Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=c32bd87c6707754ac3b67a1f0e6c6567e558eebb637fa10ab5feb79bdd52d5b0&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/ec70c0f3-1da0-4e5f-bb8f-3570a814d9be/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072043Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=7eae6f0b033eef25b85866d600dfe8ac2a260d1f2864bab7473ab716615abb3d&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/eee1f3d7-d0ec-478c-86ab-941b68bf9efb/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072044Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=3fbffceaa61757093c1ccf5b0769d509e169abdc6dc3d8c8a6846b1f33df3cc2&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/88bed368-e163-4e92-bea0-7f1cb57510e2/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072046Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=368bb62b0e381306a5e97ec067afbf0766fb9052f88a3b270f2c1400c3624e68&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><ol><li>已处理</li></ol><p>签署完成/签署失败的文件都流转至【已处理】tab，并支持下载。</p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/fab91c4b-a674-4900-8fe0-4270c0e9dc44/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072032Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=970c798efc8962033fccf08743e8cc44824b8b95c506905c3ff2a0b198ee2be8&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><h2 id="开具证明" tabindex="-1">开具证明 <a class="header-anchor" href="#开具证明" aria-label="Permalink to &quot;开具证明&quot;">​</a></h2><ol><li>登录</li></ol><p>进入登录页面输入账号和密码进入首页，点击【开具证明】模块</p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/35ef1d56-dbba-456d-a3a0-abceb466d246/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072032Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=471faa2c5e71c8f97fdbea31017b1351f4ba80bf2c7f8b1621403587ba613b50&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><ol><li>开具证明</li></ol><p>模板类型选择【系统标注模板】选择</p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/c31d7eaa-3cd1-43cc-be5c-610af255cbed/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072034Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=cf2d0da52da688de738b86080fdaa9df7ca8b0ae63c6500beed0c761e2589ed0&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p><p>模板类型选择【系统标准模板】:</p><p><img src="https://s3.us-west-2.amazonaws.com/secure.notion-static.com/b06ef75d-21bc-45b0-ac75-38c46ce79e5b/Untitled.png?X-Amz-Algorithm=AWS4-HMAC-SHA256&amp;X-Amz-Content-Sha256=UNSIGNED-PAYLOAD&amp;X-Amz-Credential=AKIAT73L2G45EIPT3X45%2F20230609%2Fus-west-2%2Fs3%2Faws4_request&amp;X-Amz-Date=20230609T072034Z&amp;X-Amz-Expires=3600&amp;X-Amz-Signature=aabc580483ef3cff30dc27358be7487b8ce9c6d239798ef1c6c696f6dc54929b&amp;X-Amz-SignedHeaders=host&amp;x-id=GetObject" alt="Untitled.png"></p>',98),A=[p];function i(n,c,d,o,r,l){return a(),t("div",null,A)}const X=e(s,[["render",i]]);export{z as __pageData,X as default};
